          <div className="col-lg-4">
            <ul className="lastlinks">
              <li></li>
              <li></li>
              <li></li>
            </ul>
          </div>
          <div className="col-lg-4">by<span>by</span></div>
          <div className="col-lg-4"></div>
        </div>
      </div>
    </div>
  );
};

export default Footer;
